import React from 'react';
import { motion } from 'framer-motion';
import { Star, TrendingUp, Phone, MapPin } from 'lucide-react';

const ClientResults = () => {
  const testimonials = [
    {
      name: "Sarah Johnson",
      business: "Plumbing Pro",
      location: "Austin, TX",
      result: "From 0 to 15 calls per day",
      rating: 5,
      text: "Rankly360 transformed our business. We went from getting maybe 1-2 calls a week to 15+ calls per day. Our phone hasn't stopped ringing since we hit the top 3 in Google Maps."
    },
    {
      name: "Mike Chen",
      business: "Elite Auto Repair",
      location: "Phoenix, AZ",
      result: "300% increase in leads",
      rating: 5,
      text: "We were struggling to compete with the big chains. Rankly360 got us to #1 in Google Maps within 45 days. Now we're turning away work because we're so busy."
    },
    {
      name: "Lisa Rodriguez",
      business: "Fresh Dental Care",
      location: "Miami, FL",
      result: "Top 3 in 30 days",
      rating: 5,
      text: "The results were incredible. We went from being invisible online to the top 3 in Google Maps in just 30 days. Our new patient appointments have doubled."
    }
  ];

  const fadeInUp = {
    initial: { opacity: 0, y: 30 },
    whileInView: { opacity: 1, y: 0 },
    transition: { duration: 0.6 }
  };

  return (
    <section id="client-results" className="relative py-20 bg-gradient-to-b from-[#09090f] to-[#0f0f1a] overflow-hidden">
      {/* Space background effects */}
      <div className="absolute inset-0">
        <div className="absolute top-28 left-1/5 w-1 h-1 bg-[#3abef9]/40 rounded-full blur-[1px]" />
        <div className="absolute top-52 right-1/5 w-0.5 h-0.5 bg-white/30 rounded-full blur-[0.8px]" />
        <div className="absolute bottom-28 left-1/4 w-1.5 h-1.5 bg-[#00ffff]/50 rounded-full blur-[1.2px]" />
        <div className="absolute bottom-52 right-1/3 w-0.8 h-0.8 bg-[#3abef9]/35 rounded-full blur-[1px]" />
      </div>

      <div className="container mx-auto px-4 relative z-10">
        <motion.div
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.6 }}
          className="text-center mb-16"
        >
          <h2 className="text-4xl md:text-5xl font-bold text-white mb-6 bg-gradient-to-r from-[#3abef9] to-[#007bff] bg-clip-text text-transparent">
            Real Results from Real Clients
          </h2>
          <p className="text-xl text-[#9ca3af] max-w-3xl mx-auto">
            See how local businesses like yours are dominating their markets and generating more leads than ever before.
          </p>
        </motion.div>

        <div className="grid md:grid-cols-3 gap-8 mb-16">
          {testimonials.map((testimonial, index) => (
            <motion.div
              key={index}
              {...fadeInUp}
              transition={{ delay: index * 0.1 }}
              className="bg-gradient-to-br from-[#10111a] to-[#0a0a0f] p-8 rounded-2xl border border-[#3abef9]/20 hover:border-[#3abef9]/40 transition-all duration-300 hover:shadow-[0_0_32px_0_rgba(58,190,249,0.15)]"
            >
              {/* Rating */}
              <div className="flex items-center mb-4">
                {[...Array(testimonial.rating)].map((_, i) => (
                  <Star key={i} className="w-5 h-5 text-[#3abef9] fill-current" />
                ))}
              </div>

              {/* Testimonial Text */}
              <p className="text-[#9ca3af] mb-6 leading-relaxed italic">
                "{testimonial.text}"
              </p>

              {/* Result */}
              <div className="flex items-center mb-4 text-[#3abef9] font-semibold">
                <TrendingUp className="w-4 h-4 mr-2" />
                {testimonial.result}
              </div>

              {/* Client Info */}
              <div className="border-t border-[#3abef9]/20 pt-4">
                <div className="text-white font-semibold">{testimonial.name}</div>
                <div className="text-[#9ca3af] text-sm">{testimonial.business}</div>
                <div className="flex items-center text-[#9ca3af] text-sm mt-1">
                  <MapPin className="w-3 h-3 mr-1" />
                  {testimonial.location}
                </div>
              </div>
            </motion.div>
          ))}
        </div>

        {/* Stats Section */}
        <motion.div
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.6, delay: 0.3 }}
          className="bg-gradient-to-r from-[#3abef9]/10 to-[#007bff]/10 p-8 rounded-2xl border border-[#3abef9]/30"
        >
          <div className="grid grid-cols-2 md:grid-cols-4 gap-8 text-center">
            <div>
              <div className="text-3xl md:text-4xl font-bold bg-gradient-to-r from-[#3abef9] to-[#007bff] bg-clip-text text-transparent mb-2">
                98%
              </div>
              <div className="text-[#9ca3af] text-sm">
                Success Rate
              </div>
            </div>
            <div>
              <div className="text-3xl md:text-4xl font-bold bg-gradient-to-r from-[#3abef9] to-[#007bff] bg-clip-text text-transparent mb-2">
                4.9/5
              </div>
              <div className="text-[#9ca3af] text-sm">
                Client Rating
              </div>
            </div>
            <div>
              <div className="text-3xl md:text-4xl font-bold bg-gradient-to-r from-[#3abef9] to-[#007bff] bg-clip-text text-transparent mb-2">
                45 Days
              </div>
              <div className="text-[#9ca3af] text-sm">
                Average to Top 3
              </div>
            </div>
            <div>
              <div className="text-3xl md:text-4xl font-bold bg-gradient-to-r from-[#3abef9] to-[#007bff] bg-clip-text text-transparent mb-2">
                500+
              </div>
              <div className="text-[#9ca3af] text-sm">
                Happy Clients
              </div>
            </div>
          </div>
        </motion.div>
      </div>
    </section>
  );
};

export default ClientResults;
